var Glob=require("../glob.js").Glob;var test=require("tap").test;test("globstar should not have dupe matches",function(a){var d="a/**/[gh]";var b=new Glob(d,{cwd:__dirname});var c=[];b.on("match",function(e){console.error("match %j",e);c.push(e)});b.on("end",function(e){console.error("set",e);c=c.sort();e=e.sort();a.same(c,e,"should have same set of matches");a.end()})});